import React from "react";
import "./styles/TechButton.css";

const TechButton = ({ label, color, onClick }) => {
  return (
  <a href="google.com">  <button
      className="tech-button"
      style={{ backgroundColor: color }}
      onClick={onClick}
    >
      {label}
      
    </button></a>
  );
};

export default TechButton;
